import { faArrowRight, faEnvelope, faLock } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { FC, useState } from 'react';
import loginPhoto from '../../images/login-photo.png';
import Button from '../Button/Button';
import FormInput from '../Form/FormInput';
import FormRedirectButton from '../Form/FormRedirectButton';

const Registration: FC = () => {
  const [name, setName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [passwordRepeat, setPasswordRepeat] = useState('');

  const handleOnSubmit = () => {
    console.log('submit');
  };

  return (
    <div className="login-container">
      <div className="login-container-left">
        <img src={loginPhoto} />
      </div>
      <form method="POST" onSubmit={handleOnSubmit} className="login-container-right">
        <h2>Registracija</h2>
        <FormInput
          placeholder="Vardas"
          type="text"
          value={name}
          onChange={(e: React.ChangeEvent<HTMLInputElement>) => setName(e.target.value)}
        />
        <FormInput placeholder="Pavardė" type="text" value={lastName} />
        <FormInput placeholder="El. Paštas" type="text" value={email} />
        <FormInput placeholder="Slaptažodis" type="password" value={password} />
        <FormInput placeholder="Pakartokite slaptažodį" type="password" value={passwordRepeat} />

        <Button styling="form-button">Registruotis</Button>

        <FormRedirectButton buttonText="Prisijungti" redirectUrl="/login" />
      </form>
    </div>
  );
};

export default Registration;
